import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../styles/consumers.css';

const Consumers = () => {
  const [consumers, setConsumers] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/api/consumers') // kontrollo portin e backend-it
      .then(res => {
        setConsumers(res.data);
      })
      .catch(err => {
        console.error("Gabim gjatë marrjes së konsumatorëve:", err);
      });
  }, []);

  return (
    <div className="consumers-container">
      <h2>Lista e Konsumatorëve</h2>
      <table>
        <thead>
          <tr>
            <th>Emri</th>
            <th>Adresa</th>
            <th>Tipi</th>
          </tr>
        </thead>
        <tbody>
          {consumers.map(consumer => (
            <tr key={consumer.id}>
              <td>{consumer.name}</td>
              <td>{consumer.address}</td>
              <td>{consumer.type}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Consumers;
